import React from "react";
import Particles from "react-tsparticles";

function App() {
  return (
    <div className="App">
      <Particles
        id="tsparticles"
        url="http://foo.bar/particles.json"
        init={this.particlesInit}
        loaded={this.particlesLoaded}
      />
    </div>
  );
}

export default App;
